import { useState } from "react";
const counter=()=>{

    const [count,setCount]=useState(0)

    const handleClick=()=>{
        setCount(count+1)
    }  


    return(
        <section>
            <h1>
                mi primer componente funcional con estados y hooks
            </h1>
            <span>
                {count}
            </span>
            <button onClick={handleClick}>
                aumentar contador
            </button>
        </section>
    )
}

export default counter;
